def row(n):
    i, J, out = 0, list(range(1, n+1)), []
    while len(J) > 1:
        i = (i + 1)%len(J)
        out.append(J.pop(i))
        i = (i + 1)%len(J)
    out += [J[0]]
    return [out.index(j)+1 for j in list(range(1, n+1))]
